import * as React from 'react';

import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import FilterListIcon from '@mui/icons-material/FilterList';
import Container from '@mui/material/Container';
export default function FilterResult() {
    const [value, setValue] = React.useState(0);

    const handleChange = (event, newValue) => {
        setValue(newValue);
    };

    return (
        <Container>
            <Tabs value={value} onChange={handleChange}    variant="scrollable"  scrollButtons="auto" allowScrollButtonsMobile  sx={{paddingBottom:'10px'}}>
                <Tab label={<div>Sonu√ß<span></span><br/><i>(12.000)</i></div>} sx={{fontSize:'12px'}}/>
                <Tab label={<div><span>Kategory</span><br/><i>(2)</i></div>} sx={{fontSize:'12px'}} />
                <Tab label={<div><span>Fiyat</span><br/><i>(1)</i></div>}   sx={{fontSize:'12px'}}/>
                <Tab label={<div><span>Fiyat</span><br/><i>(1)</i></div>}   sx={{fontSize:'12px'}}/>
                <Tab  icon={<FilterListIcon/>} sx={{fontSize:'12px'}}/>
            </Tabs>
        </Container>
    );
}
